script: |
  super -f text -I q5128.spq | sort > q5128.out

inputs:
  - name: q5128.spq
    data: |
      SELECT DISTINCT + COUNT ( * ) * 86 FROM tab0 (FORMAT parquet) WHERE NOT - col2 NOT BETWEEN + - col1 * - 93 + + - ( - col0 ) / col1 * - col0 + - col2 AND + col2;
  - name: tab0

outputs:
  - name: q5128.out
    data: |
      86
